import "./Navbar.css";
import NavbarBrand from "./NavbarBrand";
import NavbarLinks from "./NavbarLinks";
import { useState } from "react";
import ScrollspyNav from "react-scrollspy-nav";

const Navbar = () => {
  const [navbarActive, setNavbarActive] = useState(false);
  const [open, setOpen] = useState(false);
  window.addEventListener("scroll", () => {
    if (window.scrollY === 0) {
      setNavbarActive(false);
    } else setNavbarActive(true);
  });
  return (
    <nav className={`${navbarActive ? "navbar active" : "navbar"}`}>
      <NavbarBrand setOpen={setOpen} />
      <ScrollspyNav
        scrollTargetIds={["services", "section_2", "section_3"]}
        offset={100}
        activeNavClass="is-active"
        scrollDuration="1000"
        headerBackground="true"
      >
        <ul>
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="#services">Section 1</a>
          </li>
          <li>
            <a href="#section_2">Section 2</a>
          </li>
          <li>
            <a href="#section_3">Section 3</a>
          </li>
        </ul>
      </ScrollspyNav>
    </nav>
  );
};
export default Navbar;
